Karamaly (; , QaramalÄ±) is a rural locality (a village) in Safarovsky Selsoviet, Chishminsky District, Bashkortostan, Russia. The village has 3 streets and, as of 2010, a population of 71.
Geography
Karamaly is located 20&nbsp;km southwest of Chishmy, the district's administrative seat. Yashikey is the nearest rural locality.
